import React from "react";
import { Form } from "./form";
import styled, { css } from 'styled-components';
import {Title} from './Title';

const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    @media only all and (max-width: 1440px) {
        max-width: 100%!important;
        flex: 0 0 100%!important;
    }
`;
const TitleGuarda = styled.div`
    font-weight: bold;
    font-size: 34px;
    line-height: 41px;
    text-transform: uppercase;
    color: #FFFFFF;
    margin-top: 40px;
    margin-bottom: 24px;
`;
const AddressContainer = styled.div`
    margin-top: 40px;

`;
const Address = styled.div`

`;
const SmallIcon = styled.img`
    width: 30px;
    height: 30px;
    margin-top: 60px;
    margin-left: 20px;
    margin-right: 20px;

`;
const Line = styled.div`
    width: 2px;
    height: 242px;
    background: #828282;
`;
const TitileContact = styled.div`
    font-weight: bold;
    font-size: 23px;
`;
const TextContact= styled.div`
    font-weight: normal;
    font-size: 18px;
`;
function Contatti() {
    return(
        <>
        <Title/>
        <Container className="col-sm-8 mx-auto row">
            <TitleGuarda className="mx-auto text-center col-sm-12">CONTATTI</TitleGuarda>
            <AddressContainer className="row col-sm-12">
                <Address className="col-sm-3 mx-auto row">
                    <div className="col-sm-3 p-0">
                        <SmallIcon src="images/location.svg"></SmallIcon>
                        <SmallIcon src="images/location.svg"></SmallIcon>
                        <SmallIcon src="images/location.svg"></SmallIcon>
                    </div>
                    <Line></Line>
                    <div className="col-sm">
                        <div>
                            <TitileContact>TRENTO</TitileContact>
                            <TextContact>Via Praga N. 5</TextContact>
                        </div>
                        <div>
                            <TitileContact>SEREGNO</TitileContact>
                            <TextContact>Via Montorfano N.70/76</TextContact>
                        </div>
                        <div>
                            <TitileContact>OLBIA</TitileContact>
                            <TextContact>Via Liguria N.1</TextContact>
                        </div>
                    </div>
                </Address>
                <Address className="col-sm-3 mx-auto">
                    <SmallIcon src="images/whatsapp.svg"></SmallIcon>
                    <SmallIcon src="images/facebook.svg"></SmallIcon>
                    <SmallIcon src="images/youtube.svg"></SmallIcon>
                    <Line></Line>
                    <div>+39 393 989 3909</div>
                    <div>@nickname</div>
                    <div>@nickname</div>
                </Address>
                <Address className="col-sm-3 mx-auto">
                    <SmallIcon src="images/mail.png"></SmallIcon>
                    <Line></Line>
                    <div>fabrizio@tanteauto.it</div>
                    <div></div>
                    <div></div>
                </Address>
            </AddressContainer>
        </Container>
        <div className="row d-flex justify-content-center">
            <Form/>
        </div>
        </>
    );
}
export {Contatti};
